INSERT INTO `creature_template_addon` (`entry`, `path_id`, `mount`, `bytes1`, `bytes2`, `emote`, `auras`) VALUES ('16483', '0', '0', '3', '4097', '0', '0');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES
(16483, '0', '0', 'The last thing I remember is the ship falling and us getting into the pods. I\'ll go see how I can help. Thank you!', '12', '0', '100', '0', '0', '0', 'draenei survivor SAY_HEAL1'),
(16483, '0', '1', '$C, Where am I? Who are you? Oh no! What happened to the ship?', '12', '0', '100', '0', '0', '0', 'draenei survivor SAY_HEAL2'),
(16483, '0', '2', '$C You saved me! I owe you a debt that I can never repay. I\'ll go see if I can help the others.', '12', '0', '100', '0', '0', '0', 'draenei survivor SAY_HEAL3'),
(16483, '0', '3', 'Ugh... what is this place? Is that all that\'s left of the ship over there?', '12', '0', '100', '0', '0', '0', 'draenei survivor SAY_HEAL4'),
(16483, '1', '0', 'Oh, the pain...', '12', '0', '100', '0', '0', '0', 'draenei survivor SAY_HELP1'),
(16483, '1', '1', 'Everything hurts, Please make it stop...', '12', '0', '100', '0', '0', '0', 'draenei survivor SAY_HELP2'),
(16483, '1', '2', 'Ughhh... I hurt. Can you help me?', '12', '0', '100', '0', '0', '0', 'draenei survivor SAY_HELP3'),
(16483, '1', '3', 'I don\'t know if I can make it, please help me...', '12', '0', '100', '0', '0', '0', 'draenei survivor SAY_HELP4');
